import React from 'react';


const footer = () => {

    return (
        <div>

            <footer className="footer">
                <div className="content has-text-centered">
                
                <a href="https://github.com/Eugene32" target="_blank"
                                className="my-no-underline" rel="noopener noreferrer"><i className="fa-brands fa-github-square fa-2xl px-3"></i></a>
                <a href="https://www.linkedin.com/in/reynan-k-2a525032/" target="_blank"
                                rel="noopener noreferrer" class="my-no-underline"><i className="fa-brands fa-linkedin fa-2xl px-3"></i></a>
                 <a href="mailto:ekahiyang@gmail.com" target="_blank"
                                className="my-no-underline" rel="noopener noreferrer"><i className="fa-regular fa-envelope fa-2xl px-3"></i></a>
                
                <br></br>
                <br></br>
                <h4><span>©ЯK 2022</span> </h4> 
               
                </div>
            </footer>
        </div>
    );


}

export default footer;
